// -------------------------------------------------
// UTF8CHARS (modified for nu_langdetect)
// -------------------------------------------------
int ld_char_scan(const char* vbuf, int* adv)
{
 const unsigned char* buf = (const unsigned char*)vbuf;
 int c = buf[0], len = 1;
 if ((c & 0x80) == 0x00)
  ;
 else
  if (((c & 0xE0) == 0xC0) && ((buf[1] & 0xC0) == 0x80))
  {
   c = ((c & 0x1F) << 6) | (buf[1] & 0x3F);
   len = 2;
  }
  else
   if (((c & 0xF0) == 0xE0) && ((buf[1] & 0xC0) == 0x80) && ((buf[2] & 0xC0) == 0x80))
   {
    c = ((c & 0x0F) << 12) | ((buf[1] & 0x3F) << 6) | (buf[2] & 0x3F);
    if (c == 0x2013)                         c = '-';
    else if (c == 0x2019)                    c = '\'';
    else if ((c == 0x201C) || (c == 0x201D)) c = '"';
    len = 3;
   }
   else
    if (((c & 0xF8) == 0xF0) && ((buf[1] & 0xC0) == 0x80) && ((buf[2] & 0xC0) == 0x80) && ((buf[3] & 0xC0) == 0x80))
    {
     c = ((c & 0x07) << 18) | ((buf[1] & 0x3F) << 12) | ((buf[2] & 0x3F) << 6) | (buf[3] & 0x3F);
     len = 4;
    }
 if (adv) *adv = len;
 return c;
}
int ld_char_isalpha(const void*str, int*adv)
{
 wchar_t ch = ld_char_scan(str, adv);
 return iswalpha(ch);
}
int ld_str_validend(int ch, const char*str)
{
 int adv, code = ld_char_scan(str, &adv);
 if (iswalnum(code))
  if (iswpunct(ch))
   return 1;
  else
   return 0;
 else
 {  
  if (((code == '\'') || (code == '.')) && ld_char_isalpha(str + adv, NULL))
   return 0;
  else
   return 1;
 }
}
// -------------------------------------------------
// OTRIE (modified for nu_langdetect)
// -------------------------------------------------
#define ld_TRIENODE_NULL 0xFFFFFFFF
#define ld_trienode_endnode  1
#define ld_trienode_haschild 2
#define ld_trienode_hasbros  4
ld_dword ld_bs2dw(const ld_byte* s, int* adv)
{
 const ld_byte*os = s;
 ld_dword u = 0, n = 0;
 while (*s & 0x80)
 {
  u |= (*s & 0x7F) << n;
  s++; n += 7;
 }
 u |= (*s & 0x7F) << n;
 s++;
 if (adv) *adv = (int)(s - os);
 return u;
}
int ld_findlongestmatch_core(ld_byte*data, const char*ostr, const char*str, int code, int id, ld_dword*len)
{
 ld_dword      bestlen = 0;
 int        bestid = -1, adv;
 code = towlower(code);
 while (1)
 {
  int   a;
  ld_dword bros = ld_TRIENODE_NULL, child = ld_TRIENODE_NULL, childnodecount = 0;
  ld_dword ch = ld_bs2dw(data, &a);
  ld_byte  flag;
  data += a;
  flag = ld_bs2dw(data, &a);
  data += a;
  if (flag&ld_trienode_hasbros)
  {
   bros = ld_bs2dw(data, &a);
   data += a;
  }
  if (flag&ld_trienode_haschild)
  {
   child = ld_bs2dw(data, &a);
   data += a;
   childnodecount = ld_bs2dw(data, &a);
   data += a;
  }
  if (ch == code)
  {
   if (flag&ld_trienode_endnode)
   {
    if (!ld_str_validend(ch, str))
     ;
    else
     if ((ld_dword)(str - ostr) > bestlen)
     {
      int adv, ncode = ld_char_scan(str, &adv);
      if (((ncode == '\'') || (ncode == '-')) && ld_char_isalpha(str + adv, NULL))
       ;
      else
      {
       bestlen = (ld_dword)(str - ostr);
       bestid = id;
      }
     }
   }
   if (*str == 0)
    break;
   else
    if (flag&ld_trienode_haschild)
    {
     if (flag&ld_trienode_endnode)
      id++;
     data = otdata + child;
     code = ld_char_scan(str, &adv);
     code = towlower(code);
     str += adv;
    }
    else
     break;
  }
  else
   if (bros == ld_TRIENODE_NULL)
    break;
   else
   {
    if (flag&ld_trienode_endnode)
     id++;
    id += childnodecount;
    data = otdata + bros;
   }
 }
 if (len)
  *len = bestlen;
 return bestid;
}
int ld_findlongestmatch(const char*str, ld_dword*len)
{
 const char*ostr = str;
 ld_byte      *data = otdata;
 int        adv, code = ld_char_scan(str, &adv);
 str += adv;
 return ld_findlongestmatch_core(data, ostr, str, code, 0, len);
}

#define nu_langdetect_neardistance 24
nu_langid nu_langdetect(const char*text)
{
 size_t i = 0;
 int    sum[ld_langnum], cnt[ld_langnum], csum = 0, wrd = 0;
 size_t last[ld_langnum];
 memset(cnt, 0, ld_langnum * sizeof(cnt[0]));
 while (text[i])
 {
  int adv;
  if (ld_char_isalpha(text + i, &adv))
  {
   ld_dword len;
   int      id = ld_findlongestmatch(text + i, &len);
   if (id != -1)
   {
    ld_byte*data = (ld_byte*)(bdata + bidx[id]);
    int     topv = 0;
    ld_byte c = 0, p = 0, hm = data[p++];
    for(c=0;c<hm;c++)
     {
      int l = data[p++];
      int val = data[p++];

      if (cnt[l] == 0) sum[l] = 0;
      if (cnt[l] && ((i - last[l]) < nu_langdetect_neardistance))
       val++;
      if (val > topv)
       topv = val;
      sum[l] += val;
      last[l] = i;
      cnt[l]++;
     }
    csum += topv;
    i += len;
   }
   else
    while (ld_char_isalpha(text + i, &adv))
     i += adv;
   wrd++;
  }
  else
   i += adv;
 }
 if (csum)
 {
  int l, top = 0, best = -1;
  for (l = 0; l < ld_langnum; l++)
   if (cnt[l])
   {
    int val = (sum[l] * 0xFF / csum)*(cnt[l] * 0xFF / wrd);
    if (val > top)
    {
     top = val;
     best = l;
    }
   }
  return best;
 }
 else
  return -1;
}

